from collections import defaultdict


class Solution:
    def minDeletions(self, s: str) -> int:
        freq, freq_freq, N = defaultdict(int), defaultdict(int), 10**5
        booked, ans = [0] * N, 0
        for i in s:
            freq[i] += 1

        for i in freq:
            freq_freq[freq[i]] += 1

        for i in freq_freq:
            c = freq_freq[i]
            while c > 0:
                if booked[i]:
                    while c:
                        j = i
                        while j >= 0 and booked[j]:
                            j -= 1
                        booked[j] = 1
                        ans += i - max(0, j)
                        c -= 1
                else:
                    booked[i] = 1
                    c -= 1
        return ans


s = ""
obj = Solution().minDeletions(s)
print(obj)
